-- H2 2.3.232; 

CREATE CACHED TABLE "PUBLIC"."SOURCES_EMISSION"(
    "PERIOD" CHARACTER VARYING NOT NULL,
    "IDSOURCE" INTEGER NOT NULL,
    "LW63" REAL,
    "LW125" REAL,
    "LW250" REAL,
    "LW500" REAL,
    "LW1000" REAL,
    "LW2000" REAL,
    "LW4000" REAL,
    "LW8000" REAL
);
-- 359 +/- SELECT COUNT(*) FROM PUBLIC.SOURCES_EMISSION;       
CREATE INDEX "PUBLIC"."INDEX_A" ON "PUBLIC"."SOURCES_EMISSION"("PERIOD" NULLS FIRST, "IDSOURCE" NULLS FIRST);  
CREATE CACHED TABLE "PUBLIC"."RECEIVERS"(
    "THE_GEOM" GEOMETRY,
    "ID_COL" INTEGER,
    "ID_ROW" INTEGER,
    "PK" INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1 RESTART WITH 1086) NOT NULL
);   
ALTER TABLE "PUBLIC"."RECEIVERS" ADD CONSTRAINT "PUBLIC"."CONSTRAINT_C" PRIMARY KEY("PK");     
-- 1085 +/- SELECT COUNT(*) FROM PUBLIC.RECEIVERS;             

CREATE SPATIAL INDEX "PUBLIC"."INDEX_C" ON "PUBLIC"."RECEIVERS"("THE_GEOM");   
CREATE CACHED TABLE "PUBLIC"."SOURCES_GEOM"(
    "THE_GEOM" GEOMETRY SELECTIVITY 96,
    "ROAD_ID" INTEGER SELECTIVITY 5,
    "LV" INTEGER SELECTIVITY 1,
    "LV_SPD" FLOAT(24) SELECTIVITY 1,
    "HV" INTEGER SELECTIVITY 1,
    "HV_SPD" FLOAT(24) SELECTIVITY 1,
    "PK" INTEGER GENERATED BY DEFAULT AS IDENTITY(START WITH 1 RESTART WITH 2247) SELECTIVITY 100 NOT NULL
);            
ALTER TABLE "PUBLIC"."SOURCES_GEOM" ADD CONSTRAINT "PUBLIC"."CONSTRAINT_1" PRIMARY KEY("PK");  
-- 83 +/- SELECT COUNT(*) FROM PUBLIC.SOURCES_GEOM;            


CREATE TABLE PUBLIC.BUILDINGS (
	THE_GEOM GEOMETRY(POLYGON, 2154),
	PK INTEGER NOT NULL,
	HEIGHT DOUBLE PRECISION,
	PRIMARY KEY(PK)
);
